import s from "./Dialogs.module.css"

const DialogMessage = (props) => {
	console.log(props);
	return (
		<div className={s.dialogs__messages}>

			<div className={s.dialogs__mesageMe}>

				<div className={s.dialogs__img}>
					<img src="https://cs14.pikabu.ru/post_img/big/2023/02/13/8/1676295806139337963.png" alt="" />
				</div>

				<p className={s.dialogs__textFromMe}>
					{props.message}
				</p>
			</div>

			<div className={s.dialogs__messageAnother}>

				<div className={s.dialogs__imgAnother}>
					<img src="https://cs14.pikabu.ru/post_img/big/2023/02/13/8/1676295806139337963.png" alt="" />
				</div>

				<p className={s.dialogs__textFromAnother}>
					{props.messageAnother}
				</p>
			</div>


		</div>
	);
}
export default DialogMessage;
